sys_variable_value.value:
(function execute(inputs, outputs) {
  if( inputs.listener_arn[0].length == 0 && inputs.load_balancer_arn.trim() == "" ){
   throw new Error("Either of Listener ARN or Load Balancer ARN should be specified");
  }
  var region = inputs.region.trim();
  var util = new AWSLoadBalancingUtil();
  var str = util.createPayload({"ListenerArns.member" : inputs.listener_arn},null);
  var session = gs.getSession();
  session.putClientData('SN_AWS_LOAD_BALANCING_REGION', region || "us-east-1");
  session.putClientData("SN_AWS_LOAD_BALANCING_FILTER", str);
  outputs.region = region;
  outputs.load_balancer_arn = inputs.load_balancer_arn.trim();
})(inputs, outputs);

