sys_variable_value.value:
(function parse(inputs, outputs) {
    var xmlDoc = new XMLDocument2();
     xmlDoc.parseXML(inputs.sourceItem);
     outputs.targetObject.LoadBalancerArn= xmlDoc.getNodeText('/member/LoadBalancerArn');
     outputs.targetObject.ListenerArn= xmlDoc.getNodeText('/member/ListenerArn');
     outputs.targetObject.Protocol= xmlDoc.getNodeText('/member/Protocol');
     outputs.targetObject.Port= xmlDoc.getNodeText('/member/Port');
     outputs.targetObject.TargetGroupArn= xmlDoc.getNodeText('/member/DefaultActions/member/TargetGroupArn');
     outputs.targetObject.Type= xmlDoc.getNodeText('/member/DefaultActions/member/Type');
})(inputs, outputs)

